        return (
            <div className="Data2">
                <h1 style={{marginTop: 50}}>???</h1>
                <PieChart/>
            </div>
        );
    }
}

class PieChart extends React.Component {
    render(){
        return (
            <VictoryPie
                style={{ parent: { maxWidth: "30%" } }}
                colorScale={["tomato", "orange", "gold", "cyan", "navy" ]}
                data={[
                    { x: "Cats", y: 35 },
                    { x: "Dogs", y: 40 },
                    { x: "Birds", y: 55 }
                ]}
            />
        );
    }
}
